package main

import (
	"container/heap"
	"fmt"
)

func main() {
	input := inputs
	riskCount := 0
	h := &IntHeap{}
	heap.Init(h)
	basins := make([][]int, 0)
	for i, row := range input {
		for j, val := range row {
			if isRiskArea(i, j, input) {
				riskCount += val + 1
				basins = append(basins, []int{i, j})
				basinSize := countBasin(i, j, input)
				heap.Push(h, basinSize)
			}
		}
	}
	fmt.Printf("Risk Count: %d\n", riskCount)
	res := 1
	for i := 0; i < 3; i++ {
		res *= heap.Pop(h).(int)
	}
	fmt.Printf("Total: %d\n", res)
}

func countBasin(row, col int, model [][]int) int {
	if row < 0 || row >= len(model) || col < 0 || col >= len(model[row]) {
		return 0
	}
	if model[row][col] == 9 {
		return 0
	}
	model[row][col] = 9
	return 1 + countBasin(row-1, col, model) + countBasin(row, col-1, model) + countBasin(row+1, col, model) + countBasin(row, col+1, model)
}

func isRiskArea(row, col int, model [][]int) bool {
	val := model[row][col]
	if row > 0 && val >= model[row-1][col] {
		return false
	}
	if col > 0 && val >= model[row][col-1] {
		return false
	}
	if row < len(model)-1 && val >= model[row+1][col] {
		return false
	}
	if col < len(model[row])-1 && val >= model[row][col+1] {
		return false
	}
	return true
}

type IntHeap []int

func (h IntHeap) Len() int           { return len(h) }
func (h IntHeap) Less(i, j int) bool { return h[i] > h[j] }
func (h IntHeap) Swap(i, j int)      { h[i], h[j] = h[j], h[i] }

func (h *IntHeap) Push(x interface{}) {
	*h = append(*h, x.(int))
}

func (h *IntHeap) Pop() interface{} {
	old := *h
	n := len(old)
	x := old[n-1]
	*h = old[0 : n-1]
	return x
}

